    };
  },
  created: function created() {
    var gps_web_url = "http://" + location.host;
    var gps_xhyc_url = window.location.href;

    if (location.host == 'localhost:8081' || location.host == '192.168.2.25:8081') {
      // 本地测试
      var hash = location.hash.replace('#/', ''); // 演示

      gps_web_url = 'http://47.92.193.174/:8085';
      gps_xhyc_url = "http://47.92.193.174/:8085?userId=admin&page=".concat(hash);
    }

    window.$_main.init(gps_web_url, gps_xhyc_url);
  },
  beforeDestroy: function beforeDestroy() {
    window.$_main.exit();
  },
  mounted: function mounted() {
    var _this = this;

    this.ready = true;
    this.$router.push({
      path: window.$_main.page
    }).catch(function (err) {
      return err;
    });
    this.$router.onReady(function () {
      return _this.loading = false;
    });
  }
};
